        $scope.setPaginationdata=function(index){

           if(index==1){
            $scope.noofpages=[];
             for(var i=0;i<10;i++){

              if((index+i)<=$scope.totalnoofpages){
                 $scope.noofpages.push(index+i);
               }
             }
             var paginationcachedata={
              "noofPages":$scope.noofpages,
              "index":index
             }
          dashBoardService.setpaginationindex(paginationcachedata);
           $scope.showproductsbarchart=false;
           $scope.currentpage=index;
           $scope.startindex=(index-1)*50;
           $scope.endindex=index*50;
           $scope.productchartdata=$scope.barChartData.slice($scope.startindex, $scope.endindex);
           $scope.manufacturerid=productService.generateguid();

            if($scope.productchartdata.length>5){
              $scope.chartheightlength=47*$scope.productchartdata.length;
            $scope.chartheight=$scope.chartheightlength+"px";
            }
            else if($scope.productchartdata.length>=2){
              $scope.chartheightlength=52*$scope.productchartdata.length;
            $scope.chartheight=$scope.chartheightlength+"px";

            }
            else {
            $scope.chartheight="70px";
            }
            $timeout(function() {
                 $scope.showproductsbarchart=true;
            }, 
           100);

           }
         else if(index>=1&&index<=$scope.totalnoofpages&&
          index<=Math.max.apply(Math,$scope.noofpages)){
          
             var paginationcachedata={
              "noofPages":$scope.noofpages,
              "index":index
             }
             dashBoardService.setpaginationindex(paginationcachedata);
          
              if(index==($scope.noofpages[0]-1)&&$scope.currentpage!=index){
                $scope.noofpages=[];
              for(var i=0;i<10;i++){
                 $scope.noofpages.push(index-9+i);
              }
              }
            $scope.showproductsbarchart=false;
           $scope.currentpage=index;
           $scope.startindex=(index-1)*50;
           if((index*50)<$scope.totalnoOfProducts){
             $scope.endindex=index*50;
           }
           else{
            $scope.endindex=$scope.totalnoOfProducts;
           }
           $scope.productchartdata=$scope.barChartData.slice($scope.startindex, $scope.endindex);
          $scope.manufacturerid=productService.generateguid();
           if($scope.productchartdata.length>5){
              $scope.chartheightlength=47*$scope.productchartdata.length;
            $scope.chartheight=$scope.chartheightlength+"px";
            }
             else if($scope.productchartdata.length>2){
              $scope.chartheightlength=52*$scope.productchartdata.length;
            $scope.chartheight=$scope.chartheightlength+"px";
            }
            else {
            $scope.chartheight="70px";
            }
            $timeout(function() {
                 $scope.showproductsbarchart=true;
            }, 
           100);
         }
         else if(index>$scope.noofpages.length&&index<=$scope.totalnoofpages){
               $scope.noofpages=[];
             for(var i=0;i<10;i++){
                  if((index+i)<=$scope.totalnoofpages){
                    $scope.noofpages.push(index+i);
                  }
             }
             $scope.currentpage=index;
           $scope.allproductapicalls(index);
         }
        }

